import React, { useEffect, useState } from 'react';
import Section from '../../components/section';
import axios from 'axios';

function Certifications(){
    const [files, setProducts] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            const {data} = await axios.get("/api/certifications");
            setProducts(data);
        }
        return () => {

        };
    }, []) 
    return(
        <>
            <Section elementName="ertifications" HeaderText='Certification' customstyle="background-color: var(--primary);">
            <ul>
                {files.map(file => 
                    <li>
                        <div className="certification">
                            <div className="file-name">
                                <div>{file}</div>
                            </div>    
                            <embed src={file} width="100px" height="200px" />
                        </div> 
                    </li>
                )}
            </ul>
            </Section>
        </>
    );
}

export default Certifications;
